import './ExpenseItem.css';

function ExpenseItem() {
  return (
    <div>
      <div>March 22nd 2023</div>
      <div>
        <h2>Car Insurance</h2>
        <div>$131.94</div>
      </div>
    </div>
  );  
}

export default ExpenseItem;
